                        "Name": "극악기 · 멸",
                        "Desc": "스커크의 원소폭발은 원소 에너지를 의존하지 않고 <color style='color:#FFD780;'>뱀의 교활함</color>에 의존한다.<br>스커크가 뱀의 교활함을 최소 50pt 보유했을 때, 스커크는 모든 뱀의 교활함을 소모하여 원소폭발을 발동하고 전방의 공간을 찢어 고속의 연속 참격을 펼쳐 <color style='color:#99FFFF;'>얼음 원소 범위 피해</color>를 준다. 또한 발동 시 스커크가 보유한 뱀의 계략이 50pt를 초과하면, 초과한 1pt마다 이번 원소폭발로 주는 피해가 증가한다. 이런 방식으로 뱀의 교활함을 최대 12pt 카운트한다.<br><br>스커크가 <color style='color:#FFD780;'>칠상일섬</color> 상태일 때 원소폭발 「극악기 · 멸」은 「극악기 · 진」으로 대체된다.<br><br><color style='color:#FFD780;'>극악기 · 진</color><br>뱀의 교활함을 소모하지 않고 즉시 발동할 수 있는 특수한 원소폭발이다.<br>발동 후 스커크는 영락 효과를 획득하며 해당 효과는 칠상일섬 상태가 끝날 때까지 지속된다. 고유 특성 <color style='color:#FFD780;'>이외의 이치</color>가 개방되면, 스커크는 주변 일정 범위 내의 허계 균열을 흡수한다.<br>영락 효과 지속 시간 동안 0.1초마다 스커크의 일반 공격이 적을 명중하면, 이번 일반 공격으로 주는 피해가 증가한다. 또한 흡수한 허계 균열 수에 따라 <color style='color:#FFD780;'>극악기 · 진</color>으로 일반 공격으로 주는 피해가 더욱 증가한다.<br>해당 효과는 10회 발동 시 해제된다",
