                        "Desc": "주변에 있는 파티 내 캐릭터가 적에게 빙결, 초전도, 얼음 원소 확산 또는 얼음 원소 결정 반응 발동 시, 적 주변에 허계 균열을 1개 창조한다. 해당 효과는 2.5초마다 최대 1회 발동된다. 스커크 자신이 창조한 허계 균열은 필드 위에 최대 3개 존재할 수 있다.<br><br>스커크가 아래 방식으로 주변 일정 범위 내의 허계 균열을 흡수한다:<br> · <color style='color:#FFD780;'>일곱빛 섬광</color> 모드에서 강공격으로 적 명중 시.<br> · 일곱빛 섬광 모드에서 특수 원소폭발 <color style='color:#FFD780;'>극악기 · 진</color> 발동 시.<br> · 홀드로 원소전투 스킬 <color style='color:#FFD780;'>극악기 · 섬</color>을 발동해 빠른 이동 진행 시.<br><br>허계 균열을 흡수할 때마다 스커크가 <color style='color:#FFD780;'>뱀의 계략</color>을 8pt 획득한다",
