                        "Desc": "스커크가 고유 특성 <color style='color:#FFD780;'>이치 밖의 이치</color>의 효과를 통해 허계 균열을 1개 흡수할 때마다 극악기 · 참 효과를 1스택 획득한다. 스커크는 해당 효과를 소모해 협동 공격을 할 수 있고, <color style='color:#FFD780;'>일곱빛 섬광</color> 모드에서 받는 피해가 감소한다. 해당 효과 지속 시간: 15초, 최대 중첩수: 3스택. 스택마다 지속 시간은 독립적으로 계산된다.<br>고유 특성 「이치 밖의 이치」를 해금해야 한다.<br><br><color style='color:#FFD780;'>극악기 · 참</color><br> · 원소폭발 <color style='color:#FFD780;'>극악기 · 멸</color> 발동 시, 모든 <color style='color:#FFD780;'>극악기 · 참</color> 스택을 소모하여 협동 공격을 진행한다. <color style='color:#FFD780;'>극악기 · 참</color> 스택마다 스커크 공격력의 600%에 해당하는 <color style='color:#99FFFF;'>얼음 원소 피해</color>를 준다. 해당 피해는 원소폭발 피해로 간주한다.<br> · 스커크가 일곱빛 섬광모드에서 일반 공격의 세 번째 또는 다섯 번째 공격으로 적 명중 시, <color style='color:#FFD780;'>극악기 · 참</color>을 1스택 소모해 협동 공격을 3회 진행한다. 협동 공격마다 스커크 공격력의 150%에 해당하는 <color style='color:#99FFFF;'>얼음 원소 피해</color>를 준다. 해당 피해는 일반 공격 피해로 간주한다.<br> · 스커크가 일곱빛 섬광 모드에서 피해를 받을 시 <color style='color:#FFD780;'>극악기 · 참</color>을 1스택 소모해 이번 받는 피해를 80% 감소시키고, 주변의 적을 3회 공격한다. 공격마다 스커크 공격력의 150%에 해당하는 <color style='color:#99FFFF;'>얼음 원소 피해</color>를 준다. 해당 피해는 강공격 피해로 간주한다",
                        "Icon": "UI_Talent_S_SkirkNew_04"
