                        "Desc": "파티 내 주변에 있는 <color style='color:#80C0FF;'>물 원소</color> 타입 캐릭터가 <color style='color:#80C0FF;'>물 원소 피해</color>를 주거나, 파티 내 주변에 있는 다른 <color style='color:#99FFFF;'>얼음 원소</color> 타입 캐릭터가 <color style='color:#99FFFF;'>얼음 원소 피해</color>를 줄 시, 스커크가 죽음강 가르기 효과를 1스택 획득한다. 지속 시간: 20초. 최대 중첩수: 3스택. 스택마다 지속 시간은 독립적으로 계산된다. 캐릭터당 해당 방식으로 스커크에게 죽음강 가르기 효과를 최대 1스택 부여할 수 있다.<br>죽음강 가르기 효과 스택마다 스커크가 일곱빛 섬광 모드에서 일반 공격으로 주는 피해가 기본의 110%/120%/170%만큼 증가하고, 원소폭발 <color style='color:#FFD780;'>극악기 · 멸</color>로 주는 피해가 기본의 105%/115%/160%만큼 증가한다"
